import React from "react";
import BootstrapTable from "react-bootstrap-table-next";

export default class Table extends React.Component {
  products = [];
  columns = [
    {
      dataField: "id",
      text: "Product ID"
    },
    {
      dataField: "name",
      text: "Product Name"
    },
    {
      dataField: "price",
      text: "Product Price"
    }
  ];
  render() {
    return;
    <div>
      <BootstrapTable keyField="id" data={products} columns={columns} />
    </div>;
  }
}
